import Auth from "../../components/auth";
import Button from 'react-bootstrap/Button';
import {Form,FormControl,FormLabel,FormGroup} from 'react-bootstrap'
function Create() {
    return(
        <Auth>
            <h1>Create Question Page</h1>
            <Form>
                <input className="my-2" placeholder="Question title"></input><br />
                <input className="my-2" placeholder="Correct answer"></input><br />
                <input className="my-2" placeholder="Other answer 1"></input><br />
                <input className="my-2" placeholder="Other answer 2"></input><br />
                <Form.Control className="my-2" placeholder="Other answer 3" /><br />
            </Form>
            <Button className="my-2">Submit</Button> <br />
        </Auth>
    )
}

export default Create
